create table course_score
(
    s_id        varchar(20)   not null comment '学号',
    s_name      varchar(15)   null comment '姓名',
    c_name      varchar(20)   null comment '课程名称',
    daly_score  double        null comment '平时成绩',
    test_score  double        null comment '期末成绩',
    final_score double        null comment '总成绩',
    isdel       int default 0 not null comment '逻辑删除'
)
    comment '课程成绩';

create index course_score_s_id_index
    on course_score (s_id);

